import './Nav.css'
import myImage from './assets/images/logo192.png' 

function Nav () {
    return (
        <nav>
            <i className="fa-solid fa-earth-americas"></i>
            <img src={myImage} alt="globe-icon" />
            <h3>my travel jounal.</h3>
        </nav>
    )
}

export default Nav;
